import React from 'react';
import {Button } from '@mui/material';
import UserProfile from './components/UserProfile';


function App() {
  function MyComponent(){ 
      const user = {
      name : 'Rishabh Gupta',
      avatarURL: 'https://scontent-del1-2.xx.fbcdn.net/v/t39.30808-6/310438264_181434067731886_3912525372775804684_n.jpg?_nc_cat=110&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=-f0fx-p7emYAX_3gxhE&_nc_ht=scontent-del1-2.xx&oh=00_AfCzS5OHlzGgPqqIOdb3_Tdd9DvsxJKANjVnmr5PG15XDw&oe=641DAF94',
      bio: 'I am a student at KIET Ghaziabad'
    }
  }
  return (
    <div>
      <Button variant="contained" color="primary">Login</Button>
      <UserProfile user={user} />
    </div>
  );
}

export default App;
